void complex_sqr_abs(complex_t xi_z, double *xo_abs)
{
	*xo_abs = xi_z.img*xi_z.img + xi_z.real*xi_z.real;
}

void fft(complex_t *x,int m)
{
	complex_t *w;
	int n = 1;

	complex_t u,temp,tm;
	complex_t *xi,*xip,*xj,*wptr;

	int i,j,k,l,le,windex;

	double arg;
	complex_t wtemp1;
	complex_t wtemp2;
	complex_t wrecur;

	/* n = 2**m = fft length */
	n = 1 << m;
	le = n/2;

	/* allocated the storage for w */
	w = (complex_t*) calloc(le-1,sizeof(complex_t));

	/* calculate the w values recursively */
	arg = 4.0 * atan(1.0) / le;		/* PI/le calculation */
	wrecur.real = wtemp1.real = cos(arg);
	wrecur.img = wtemp1.img = -sin(arg);
	xj = w;
	for (j=1;j<le;j++)
	{
		xj->real = (float) wrecur.real;
		xj->img = (float)wrecur.img;
		xj++;
		wtemp2.real = wrecur.real*wtemp1.real - wrecur.img*wtemp1.img;
		wrecur.img = wrecur.real*wtemp1.img + wrecur.img*wtemp1.real;
		wrecur.real = wtemp2.real;

	}

	/* start fft */
	le = n;
	windex = 1;

	for (l=0;l<m;l++)
	{
		le = le /2;

		/* first iteration with no multiplies */
		for (i=0; i<n;i = i + 2*le)
		{
			xi = x + i;
			xip = xi + le;
			temp.real = xi->real + xip->real;
			temp.img = xi->img + xip->img;
			xip->real = xi->real - xip->real;
			xip->img = xi->img - xip->img;
			*xi = temp;
		}

		/* remaining iterations use stored w */
		wptr = w + windex - 1;
		for (j=1;j<le;j++)
		{

			u = *wptr;
			for(i=j;i<n;i = i + 2*le)
			{
				xi = x + i;
				xip = xi + le;
				temp.real = xi->real + xip->real;
				temp.img = xi->img + xip->img;
				tm.real = xi->real - xip->real;
				tm.img = xi->img - xip->img;
				xip->real = tm.real * u.real - tm.img * u.img;
				xip->img = tm.real * u.img + tm.img * u.real;
				*xi = temp;
			}
			wptr = wptr + windex;
		}
		windex = 2 * windex;
	}

	/* rearrange data by bit reversing */
	j = 0;
	for (i=1;i<(n-1);i++)
	{
		k = n/2;
		while (k <=j)
		{
			j = j - k;
			k = k/2;
		}
		j = j+k;
		if (i<j)
		{
			xi = x + i;
			xj = x + j;
			temp = *xj;
			*xj = *xi;
			*xi = temp;
		}
	}

	/* free allocation storage */
	free(w);
}
